import { ConnectionStates } from "mongoose";

const reducer = (state=[], action) => {
    switch (action.type) {
        case 'FETCH_ALL':   
            return state;
            break;

        case 'CREATE':
            return ConnectionStates
            break;

        default:

            break;
    }
}
